import React from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { add, addWhistlist, removeWhistlist } from '../Redux/actions';
import { Link } from 'react-router-dom';
import { addtoSingle } from '../Redux/actions/SingleAction';
import { toast } from 'react-toastify';

// Image importing section
import greenHeart from '../Assets/greenHeart.png';
import heart from '../Assets/heart.png';
import cart from '../Assets/addCart_icon.png';

const Products = (props) => {
  const dispatch = useDispatch();
  const cartData = useSelector((state) => state.cart);
  const wishList = useSelector((state) => state.Whistlist);
  const [isWhist, setIsWhist] = React.useState(false);

  const addToSinglePage = (e, id, qty = 1) => {
    e.stopPropagation();
    dispatch(addtoSingle(id, qty));
  };

  const addToCart = (e, id) => {
    e.stopPropagation();
    const itemInCart = cartData.find((o) => o.id === id);

    if (itemInCart) {
      toast.error('Item is already in the cart', {
        position: 'bottom-right',
        autoClose: 2000,
        theme: 'colored',
      });
    } else {
      dispatch(add(id));

      toast.success('Item added to the cart', {
        position: 'bottom-right',
        autoClose: 3000,
        theme: 'colored',
      });
    }
  };

  const addToWhistlist = (e, id) => {
    e.stopPropagation();
    dispatch(addWhistlist(id, true));
  };

  const removeFromWhistlist = (e, id) => {
    e.stopPropagation();
    dispatch(removeWhistlist(id, false));
  };

  return (
    <div className="card border-0 product-card p-3 bg-body-tertiary" style={{ width: '310px' }}>
      <Link className="text-decoration-none text-dark" to="/single_product" onClick={(e) => addToSinglePage(e, props.unqid)}>
        <img src={props.img} className="prod-img" style={{ width: 'auto', height: '369px' }} alt={props.name} />
      </Link>
      <p className="card-img-overlay w-50" style={{ marginLeft: '0px', marginTop: '25px', zIndex: 1 }}>
        <b
          className="p-1 text-white"
          style={{
            display: props.off <= 0 ? 'none' : 'visible',
            backgroundColor: props.off < 26 ? 'green' : props.off >= 26 && props.off <= 50 ? 'orange' : '#F02681',
          }}
        >
          -{props.off}%
        </b>
      </p>
      {props.wstatus ? (
        <img
          src={greenHeart}
          className="card-img-overlay rounded-circle p-2 bg-white"
          style={{ marginLeft: '72%', marginTop: '37px', zIndex: 1 }}
          onClick={(e) => {
            removeFromWhistlist(e, props.unqid);
          }}
          alt="Remove from Wishlist"
        />
      ) : (
        <img
          src={heart}
          className="card-img-overlay rounded-circle p-2 bg-white"
          style={{ marginLeft: '72%', marginTop: '37px', zIndex: 1 }}
          onClick={(e) => {
            addToWhistlist(e, props.unqid);
          }}
          alt="Add to Wishlist"
        />
      )}
      <button className="cart-btn btn btn-dark rounded-0" onClick={(e) => addToCart(e, props.unqid)}>
        <img src={cart} width="25px" alt="Add to Cart" />
        Add To Cart
      </button>
      <h5 className="text-center prod-txt mt-3">
        <Link className="text-decoration-none text-dark" to="/single_product" onClick={(e) => addToSinglePage(e, props.unqid)}>
          {props.name}
        </Link>
      </h5>
      {props.off > 0 ? (
        <h4 className="text-center ms-4 prod-txt">
          <span style={{ textDecoration: 'line-through' }} className="fs-5">
            ₹{props.price}
          </span>{' '}
          <span className="prod-txt">₹{props.price - Math.floor((props.off / 100) * props.price)}</span>
        </h4>
      ) : (
        <h4 className="text-center ms-4 prod-txt">₹{props.price}</h4>
      )}
    </div>
  );
      }
